DROP TABLE IF EXISTS `user`;
CREATE TABLE IF NOT EXISTS `user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `email` varchar(128) NOT NULL,
  `password` varchar(128) NOT NULL,
  `full_name` varchar(128) NOT NULL,
  `address` varchar(128) NOT NULL,
  `passport_number` varchar(16) NOT NULL,
  `gender` enum('male','female') NOT NULL,
  `date_of_birth` date NOT NULL,
  `nationality` varchar(64) NOT NULL,
  `type` enum('admin','consultant','patient') NOT NULL,
  `notification` enum('local','email','sms','all') NOT NULL DEFAULT 'local',
  `password_token` varchar(255) DEFAULT NULL,
  `token_expiry` datetime DEFAULT NULL,
  `location` varchar(255) NOT NULL DEFAULT '' COMMENT 'country location',
  `specialization` varchar(255) NOT NULL DEFAULT '' COMMENT 'only for "Consultant"',
  PRIMARY KEY (`id`),
  UNIQUE KEY `email` (`email`),
  UNIQUE KEY `id` (`id`),
  KEY `id_2` (`id`)
) ENGINE=InnoDB  DEFAULT CHARSET=latin1 AUTO_INCREMENT=7 ;

